import React from 'react'

import '../../App.css'
import '../../Assets/CSS/Form/FormContent.css'

class FormContent extends React.Component {

    constructor(){
        super()
        this.state = {
            nama: "",
            hp: "",
            email: "",
            namaUsaha: "",
            bidangSelected: false,
            lokasiSelected: false,
            bidang: "",
        }

        this.handleCheckNama = this.handleCheckNama.bind(this);
        this.handleCheckHp = this.handleCheckHp.bind(this);
        this.handleCheckEmail = this.handleCheckEmail.bind(this);
        this.handleCheckNamaUsaha = this.handleCheckNamaUsaha.bind(this);
    }

    handleCheckNama = (event) => {
        this.setState({
            nama: event.target.value
        });
    }

    handleCheckHp = (event) => {
        this.setState({
            hp: event.target.value
        });
    }

    handleCheckEmail = (event) => {
        this.setState({
            email: event.target.value
        });
    }

    handleCheckNamaUsaha = (event) => {
        this.setState({
            namaUsaha: event.target.value
        });
    }

    render(){
        return (
            <section>
                <div className="form-container">
                    <div className="form-title">
                        <h1>
                            Form Pendaftaran
                        </h1>
                    </div>
                    <div className="form-bg" />
                    <div className="form-input">
                        <input type="text" placeholder="Name Lengkap"
                        onChange={this.handleCheckNama}
                        value={this.state.nama} />
                        <input type="text" placeholder="Nomor HP" />
                        <input type="text" placeholder="Email" />

                        <hr />

                        <input type="text" placeholder="Nama Usaha" />
                        <div className="select">
                            <select name="slct" id="slct"
                                onChange={this.handleBidang} value={this.state.bidang}>
                                <option selected disabled value="default">Pilih Bidang Usaha</option>
                                <option>Bidang Jasa</option>
                                <option>Bidang Finansial</option>
                                <option>Bidang Komunikasi</option>
                                <option>Bidang Transportasi</option>
                                <option>Bidang Konstruksi</option>
                                <option>Bidang Manufaktur</option>
                                <option>Bidang Produksi Bahan Mentah</option>
                                <option>Bidang Pertanian dan Perkebunan</option>
                                <option>Lain Lain</option>
                            </select>
                        </div>
                        <div className="select">
                            <select name="slct" id="slct">
                                <option selected disabled>Pilih Lokasi Usaha</option>
                                <option>Bali</option>
                                <option>Banten</option>
                                <option>DKI Jakarta</option>
                                <option>Jawa Barat</option>
                                <option>Jata Tengah</option>
                                <option>Jawa Timur</option>
                                <option>Kalimantan Barat</option>
                                <option>Kalimantan Tengah</option>
                                <option>Kalimantan Timur</option>
                                <option>Kalimantan Selatan</option>
                                <option>Kalimantan Utara</option>
                                <option>Yogyakarta</option>
                            </select>
                        </div>
                    </div>
                    <div className="form-submit">
                        <button className="header-button1">
                            <b>Kirim</b>
                        </button>
                    </div>
                    <div className="form-bg1" />
                </div>
            </section>
        )
    }
}

export default FormContent
